import React from 'react';
import {
  Avatar,
  Box,
  Button,
  Container,
  Grid,
  makeStyles,
  TextField,
  Typography,
  List,
  ListSubheader
} from '@material-ui/core';
import Typist from 'react-typist';
import Fade from 'react-reveal/Fade';

import '../App.css'




function Homepage ({ match }) {
  const [titleDone, setTitleDone] = React.useState(false)
  function handleTitleDone() {
    setTitleDone(true)
  }
  function body() {
    return (
      <Fade>
            <p className='body'> I'm a Full-Stack developer.</p>
            <Button className={'button'}> View my work </Button>
      </Fade>
    )
  }
  return(
    <div>
      <div>
        <Typist 
          cursor={{show:false}}
          onTypingDone={handleTitleDone}
        >
          <p className='name'> Hello, I'm Hoya.</p> 
        </Typist>
        {
          titleDone ?         
         body():null
        }

    </div>      
  </div>
  )
}
export default Homepage
